import { Container } from 'react-bootstrap';
import Menu from './componentes/Menu';
import Autores from './paginas/Autores';
import Home from './paginas/Home';
import AutorCad from './paginas/AutorCad';

function App() {
  return (
    <div>
      <Menu />

      <Container>

        <Home />
        <Autores />
        <AutorCad />
      </Container>
    </div>
  );
}

export default App;
